class Solution:
    def getListOfFactors(self, num: int) -> List[int]:
        s = []

        if num <= 1:
            return s

        while(num % 2 == 0):
            s.append(2)
            num //= 2

        for i in range(3, int(sqrt(num))+1, 2):
            while(num % i == 0):
                s.append(i)
                num //= i

        if num > 1:
            s.append(num)

        return s

    def minJumps(self, nums: List[int]) -> int:
        resource.setrlimit(resource.RLIMIT_AS, (1000*1024*200,1000*1024*200))

        n = len(nums)
        x = [self.getListOfFactors(x) for x in nums]
        m = {}

        print(x)

        for i, arr in enumerate(x):
            if len(arr) == 1:
                if arr[0] in m:
                    m[arr[0]].append(i)
                else:
                    m[arr[0]] = [i]

        print(m)

        q = deque()
        visited = [False]*n

        q.append((0, 0)) # indx, distance
        visited[0] = True

        while(len(q)):
            node, distance = q.popleft()
            visited[node] = True

            if node == n-1:
                return distance

            if node > 0 and not visited[node-1]:
                q.append((node-1, distance+1))
            if node < n-1 and not visited[node+1]:
                q.append((node+1, distance+1))

            m[x[node]]
            
            q.append((neigbour, distance+1))


        return -1
